import numpy
import random
import string

def rnd_training_data(n=10000):
    training_data = []
    for x in range(0, n):
        type = ['Stories', 'Address', 'Postal Code'][random.randint(0,2)]
        data = generate_data(type)
        if type == 'Stories':
            output = [[1], [0], [0]]
        elif type == 'Address':
            output = [[0], [1], [0]]
        elif type == 'Postal Code':
            output = [[0], [0], [1]]
        training_data.append([numpy.array(data), numpy.array(output)])

    return training_data

def rnd_test_data(n=1000):
    training_data = []
    for x in range(0, n):
        type = ['Stories', 'Address', 'Postal Code'][random.randint(0,2)]
        data = generate_data(type)
        if type == 'Stories':
            output = 0
        elif type == 'Address':
            output = 1
        elif type == 'Postal Code':
            output = 2
        training_data.append([numpy.array(data), numpy.array(output)])

    return training_data


def generate_data(type):
    if type == 'Stories':
        stories = random.randint(0,10)
        ascii_stories = [[float(ord(c))] for c in str(stories/1.0)]
        ascii_stories += (10 - len(ascii_stories)) * [[0.0]]
        return ascii_stories
    elif type == 'Address':
        address_num = str(random.randint(1, 999))
        street_first_letter = random.choice(string.ascii_uppercase)
        street_other_letters = ''.join(random.choice(string.ascii_uppercase + string.digits) for _ in range(2))
        street_suffix = random.choice(['St', 'Ct', 'Rd', ''])
        address = address_num + ' ' + street_first_letter + street_other_letters + ' ' + street_suffix
        ascii_address = [[float(ord(c))] for c in address]
        ascii_address += (10 - len(ascii_address)) * [[0.0]]
        return ascii_address
    elif type == 'Postal Code':
        code = ''.join(random.choice(string.digits) for _ in range(5))
        ascii_code = [[float(ord(c))] for c in code]
        ascii_code += (10 - len(ascii_code)) * [[0.0]]
        return ascii_code

def convert_str(str):
    return [[ord(c)] for c in str[0:10]] + [[0]] * (10 - len(str))

